import React from 'react';
import './Dashboard.css';
import jobTrackerBg from './assets/jobTrackerBg.jpg';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faUser } from '@fortawesome/free-solid-svg-icons';

const Dashboard = ({ profile, logout }) => {
  return (
    <div className="dashboard">
      <header className="dashboard-header">
        <img src={jobTrackerBg} alt="JobTrackr logo" className="logo" />
        <h1>JobTrackr</h1>
        <div className="user-profile">
          <img
            src={profile.picture}
            alt="user"
            className="profile-img"
            onError={(e) => {
              e.target.onerror = null;
              e.target.src = <FontAwesomeIcon icon={faUser} />;
            }}
          />
          <div className="user-dropdown">
            <img
              src={profile.picture}
              alt="user"
              onError={(e) => {
                e.target.onerror = null;
                e.target.src = <FontAwesomeIcon icon={faUser} />;
              }}
            />
            <p>{profile.name}</p>
            <p>{profile.email}</p>
            <button onClick={logout}>Log out</button>
          </div>
        </div>
      </header>
      {/* Add more content here for the dashboard */}
    </div>
  );
};

export default Dashboard;
